               function loadCssPropertiesButtonClose() {
                  // Prepara propiedades del div Close
                  var closeZIndex=Z_INDEX_MAIN;
                  var closeDisplay="block";
                  var closePosition="absolute";
                  var closeRight="0px";
                  var closeTop="0px";
                  var closeMarginTop="-5px";
                  var closeOverflow="visible";
                  var closeCursor="pointer";
                  var closeFontFamily="verdana";
                  var closeFontSize="14px";
                  var closeFontWeight="bold";
                  var closeColor=matchedView.closeButtonColor;
                  var closeOpacity=matchedView.closeButtonOpacity;
                  var closeButtonDelay=matchedView.closeButtonDelay;
                  var closeButtonImgUrl=matchedView.closeButtonImgUrl;
                  var closeButtonCountdown=matchedView.closeButtonCountdown;

                  // Si no trae color, setea el default
                  if (closeColor===undefined || closeColor===null) {
                     closeColor="#CCCCCC";
                  }

                  // Si no trae opacity, setea el default
                  if (closeOpacity===undefined || closeOpacity===null) {
                     closeOpacity=100;
                  }

                  closeOpacity=closeOpacity / 100;

                  // Si no trae delay, setea el default
                  if (closeButtonDelay===undefined || closeButtonDelay===null || isNaN(closeButtonDelay)) {
                     closeButtonDelay=0;
                  }

                  else {
                     closeButtonDelay=parseInt(closeButtonDelay);
                  }

                  // Verifica si el boton de close tiene imagen asociada o no
                  var closeButtonHasImg=false;

                  if (closeButtonImgUrl !==undefined && closeButtonImgUrl !==null && closeButtonImgUrl !=="undefined"&& closeButtonImgUrl.length > 0) {
                     closeButtonHasImg=true;
                  }

                  // Setea propiedades genericas del boton de close
                  var closeButtonStyle=loadCloseButtonStyle(closeDisplay, closeZIndex, closePosition, closeRight, closeTop, closeMarginTop, closeOverflow, closeCursor, closeOpacity);

                  if (closeButtonHasImg) {
                     closeButtonStyle +="width: 20px;";
                     closeButtonStyle +="height: 20px;";
                     closeButtonStyle +="background-image: url("+ closeButtonImgUrl + ");";
                     closeButtonStyle +="background-repeat: round;";
                     closeButtonStyle +="background-size: cover;";
                  }

                  else {
                     closeButtonStyle +="width: 10px;";
                     closeButtonStyle +="height: 15px;";
                     closeButtonStyle +="color: "+ closeColor + ";";
                     closeButtonStyle +="font-family: "+ closeFontFamily + ";";
                     closeButtonStyle +="font-size: "+ closeFontSize + ";";
                     closeButtonStyle +="font-weight: "+ closeFontWeight + ";";
                  }

                  if (closeButtonCountdown && closeButtonDelay > 0) {
                     var countdownStyle=loadCountdownStyle(closeDisplay, closeZIndex, closePosition, closeRight, closeTop, closeMarginTop, closeOverflow, closeCursor, closeOpacity, closeButtonDelay, closeColor, closeFontFamily, closeFontSize, closeFontWeight);
                     var countdownElementId="countdownElementId";
                     var countdownElement=buildCountdownElement(countdownElementId, countdownStyle, closeButtonDelay);
                     jqNoti('#'+ AD_ID).append(countdownElement);

                     var countdownIntervalId=setInterval(function () {
                        closeButtonDelay--;
                        jqNoti('#'+ countdownElementId).text(closeButtonDelay);
                        jqNoti('#'+ countdownElementId).width(calculateCountdownWidth(closeButtonDelay));
                     }

                     , 1000);
                  }

                  // Agrega el Boton Close con delay
                  setTimeout(function () {
                     if (closeButtonCountdown) {
                        clearInterval(countdownIntervalId);
                        jqNoti('#'+ countdownElementId).remove();
                     }

                     var closeButton="<a id='adButtonClose' onclick='ctSuperFunction.closeAdNADIP()' style='"+ closeButtonStyle + "'>";

                     if ( !closeButtonHasImg) {
                        closeButton +="x";
                     }

                     closeButton +="</a>";
                     jqNoti('#'+ AD_ID).append(closeButton);
                  }

                  , closeButtonDelay * 1000);
               }

               function loadCloseButtonStyle(closeDisplay, closeZIndex, closePosition, closeRight, closeTop, closeMarginTop, closeOverflow, closeCursor, closeOpacity) {
                  var closeButtonStyle="float: right;";
                  closeButtonStyle +="display: "+ closeDisplay + ";";
                  closeButtonStyle +="z-index: "+ closeZIndex + ";";
                  closeButtonStyle +="position: "+ closePosition + ";";
                  closeButtonStyle +="right: "+ closeRight + ";";
                  closeButtonStyle +="top: "+ closeTop + ";";
                  closeButtonStyle +="margin-top: "+ closeMarginTop + ";";
                  closeButtonStyle +="overflow: "+ closeOverflow + ";";
                  closeButtonStyle +="cursor: "+ closeCursor + ";";
                  closeButtonStyle +="opacity: "+ closeOpacity + ";";
                  return closeButtonStyle;
               }

               function loadCountdownStyle(closeDisplay, closeZIndex, closePosition, closeRight, closeTop, closeMarginTop, closeOverflow, closeCursor, closeOpacity, closeButtonDelay, closeColor, closeFontFamily, closeFontSize, closeFontWeight) {
                  var countdownStyle="float: right;";
                  countdownStyle +="display: "+ closeDisplay + ";";
                  countdownStyle +="z-index: "+ closeZIndex + ";";
                  countdownStyle +="position: "+ closePosition + ";";
                  countdownStyle +="right: "+ closeRight + ";";
                  countdownStyle +="top: 2px;";
                  /* + closeTop + ";";*/
                  countdownStyle +="margin-top: "+ closeMarginTop + ";";
                  countdownStyle +="overflow: "+ closeOverflow + ";";
                  countdownStyle +="cursor: "+ closeCursor + ";";
                  countdownStyle +="opacity: "+ closeOpacity + ";";
                  countdownStyle +="height: 15px;";
                  countdownStyle +="color: "+ closeColor + ";";
                  countdownStyle +="font-family: "+ closeFontFamily + ";";
                  countdownStyle +="font-size: "+ closeFontSize + ";";
                  countdownStyle +="font-weight: "+ closeFontWeight + ";";
                  return countdownStyle;
               }

               function calculateCountdownWidth(closeButtonDelay) {
                  return closeButtonDelay.toString().length * 10 + "px";
               }

               function buildCountdownElement(countdownElementId, countdownStyle, closeButtonDelay) {
                  var countdownWidth=calculateCountdownWidth(closeButtonDelay);
                  return "<a id='"+ countdownElementId + "' style='width: "+ countdownWidth + countdownStyle + "'>"+ closeButtonDelay + "</a>";
               }

